import React from "react";
import styles from "../styles/Product.module.scss";


function Product(props) {
    return (
        <>
            <div className={styles.Product}>
                <h2>{props.name}</h2>
                <p>{props.description}</p>
                <p>{props.price}</p>
            </div>
        </>
    );
}

export default Product;
